The 2020 United States women's Olympic basketball team competed in the Games of the XXXII Olympiad which were held in Tokyo, Japan, and were delayed a year until 2021 because of the COVID-19 pandemic. The U.S. women's Olympic team won their ninth gold medal, and seventh consecutive, at the event. The United States defeated Japan in the gold medal final en route to their eighth victory at the event. The team was led by Dawn Staley, three-time gold medalist with the Team USA as a player.
